import React from 'react';
import Navbar from './global-components/navbar';
import PageHeader from './global-components/page-header';
import OnlineSupport from './section-components/onsite-support-near-me';
import Faq from './section-components/faq-v2';
import reviewdata from '../data/reviewdata.json';
import Subscribe from './section-components/subscribe';
import FooterV2 from './global-components/footer-v1';

const About = () => {
    return <div>
        <Navbar />
        <PageHeader headertitle="Onsite Technical Support" />
        <OnlineSupport />
        <Faq  />
        <Subscribe  />
        <FooterV2 review={reviewdata.aolloginerrorReview} />
    </div>
}

export default About
